      .result-content {
        display: none;
        position: absolute;
        top: 0;
        left: 0;
        z-index: 99;
        width: 100vw;
        height: 100vh;

        overflow: hidden;
      }

      #container {
        display: none;
      }

      .result-box {
        display: flex;
        flex-direction: column;
        justify-content: center;
        align-items: center;
        width: 100vw;
        height: 100vh;
        overflow: hidden;

        color: #fff;
        font-size: 26px;
        background-color: rgba(0, 0, 0, 0.8);
      }

      .result-content img {
        width: 75%;
        max-width: 500px;
      }

      /* @import url("@/assets/reset.css"); */
      .button-box {
        margin-top: 5vh;
        display: flex;
        justify-content: space-evenly;
      }

      .magicBox {
        position: absolute;
        top: 12%;
        left: 50%;
        transform: translateX(-50%);
        width: 90%;
      }

      .StoneNest-back .buttom-item {
        width: 65px;
        height: 60px;
      }

      .buttom-item img {
        width: 100%;
        height: 100%;
      }

      .button-box > .buttom-item {
        width: 150px;
        height: 64px;
      }

      .modal {
        position: fixed;
        width: 100%;
        height: 100%;
        background: rgb(0, 0, 0, 0.3);

        display: flex;
        justify-content: center;
        align-items: center;
      }

      .model-img {
        width: 90%;
      }

      .StoneNest-back {
        display: none;
        position: absolute;
        top: 0;
        margin-top: 5vh;
        width: 100%;
      }

      .StoneNest-back img {
        margin-left: 20px;
        width: 100%;
        height: 100%;
      }

      .StoneNest-count {
        display: flex;
        justify-content: center;
        align-items: center;
        position: absolute;
        top: 0;
        left: 54%;
        width: 131px;
        height: 60px;
        background-size: 100% 100%;
        color: #5c2216;

      .StoneNest-wrap ul {
        transform: translate(2%, 1%);
        width: 87%;
        height: 73%;
        display: grid;
        grid-template-columns: 33% 33% 33%;
        grid-template-rows: 33% 33% 33%;
        /* transform: translate(-2%, 0%); */
      }

      .StoneNest-wrap ul li {
        width: 100%;
        height: 100%;

        position: relative;
      }

      .StoneNest-wrap ul li:nth-child(5) {
        grid-column-start: 2;
        grid-column-end: 3;
        grid-row-start: 2;
        grid-row-end: 3;
      }

      /* .StoneNest-wrap ul li:nth-child(3),
      .StoneNest-wrap ul li:nth-child(6),
      .StoneNest-wrap ul li:nth-child(9) {
        margin-right: 0;
      }

      .StoneNest-wrap ul li:nth-child(7),
      .StoneNest-wrap ul li:nth-child(8),
      .StoneNest-wrap ul li:nth-child(9) {
        margin-bottom: 0;
      } */

      .StoneNest-wrap ul li img {
        width: 82%;
      }

      .start {
        display: flex;
        justify-content: center;
        align-items: flex-end;
        width: 100%;
        height: 100%;
        background-repeat: no-repeat;
        background-size: 80% 80%;
        background-position: center center;
      }

      .StoneNest-wrap ul li.xx .item-xx {
        width: 1rem;
        height: 1rem;
        line-height: 0.4rem;
        margin: 0.2rem StoneNest 0 StoneNest;
        background-color: #041726;
        padding: 0.14rem 0.14rem 0.14rem 0.16rem;
        font-size: 0.33rem;
        color: #035d68;
      }

      .StoneNest-wrap ul li.rw {
        display: flex;
        justify-content: center;
        align-items: center;
        /* background-image: v-bind("'url(' + imageReat.bgItem + ')'") ; */
        background-repeat: no-repeat;
        background-size: 100% 100%;
        background-position: center center;
      }

      .StoneNest-wrap ul li.rw .header {
        display: flex;
        height: 30%;
        justify-content: center;
      }

      .header {
        display: flex;
        height: 30%;
        justify-content: center;
      }

      .StoneNest-wrap ul li.rw img {
        width: 76%;
        height: 76%;
        /* margin: 0 0 0 5px; */
      }

      .StoneNest-wrap ul li.rw .name {
        width: 100%;
        height: 100%;
        line-height: 0.32rem;
        margin: 0 StoneNest;
        text-align: center;
        font-size: 0.23rem;
        /* background-image: url("img/name_bg.png"); */
        background-repeat: no-repeat;
        background-size: 100% 100%;
        background-position: center center;
        color: #00ffff;
      }

      .StoneNest-wrap ul li.active {
        background-color: #9c7a61;
      }

      .StoneNest-wrap ul li.active::after {
        content: " ";
        display: block;
        position: absolute;
        top: 0;
        left: 0.05rem;
        width: 100%;
        height: 100%;
        /* background-color: rgba(188, 133, 28, 0.3); */
      }

      .StoneNest-wrap ul li.active .name {
        /* background-image: url('img/name_current_bg.png'); */
        /* background-repeat: no-repeat;
          background-size: 100% 100%;
          background-position: center center;
          color: #fff; */
      }

      .StoneNest-wrap-img {
        width: 84%;
        position: absolute;
        top: -20%;
        left: 7%;
        z-index: 8;
      }

      .home-box {
        display: none;
        width: 100vw;
        height: 100vh;

        overflow: hidden;
        display: flex;
        justify-content: center;
        align-items: center;
      }

      .home-box img {
        width: 70%;
      }
